import React from 'react';
import './App.css';

import YouTubeVideoListHolder from '../YouTubeVideoListHolder/YouTubeVideoListHolder';
import Header from '../Header/Header';

class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {
      videos:[],

    };
  }

  callAPI() {
    fetch("http://localhost:9000/videos/cousin_clip")
      .then(res => res.json())
      .then(res => this.setState({videos: res}))
      .catch(err => err);
  }

  componentWillMount() {
    this.callAPI();
  }

  render() {
    return (
      <div className="App">
        <Header />
        <YouTubeVideoListHolder videoList={this.state.videos}/>
      </div>
    );
  }
}

export default App;
